import React from "react";
import './css/Header.css';

function Header() {
    props = {active}
    let project_active = '';
    let skills_active = '';
    let about_active = '';
    let contact_active = '';

    if (props.section === 'projects') {
        project_active = 'active';
    } else if (props.section === 'skills') {
        skills_active = 'active';
    } else if (props.section === 'about') {
        about_active = 'active';
    } else if (props.section === 'contact') {
        contact_active = 'active';
    }

    return(
        <>
            <div className="header">
                <div className="logo">
                    <h2>Dagos</h2>
                </div>
                <div className="menu">
                    <a className={project_active} href="/">Projects</a>
                    <a className={skills_active} href="/">Skills</a>
                    <a className={about_active} href="/">About</a>
                    <a className={contact_active} href="/">Contact</a>
                </div>
            </div>
        </>
    );
}
export default Header;
